import NavBar from "./components/navbar"

export default function Home() {
    return (
        <div>
            <NavBar />
            <h1>My Calendar Events</h1>
        <ul>
            {events.map(event => (
            <li key={event.id}>
                {event.summary} - {event.start.dateTime}
            </li>
            ))}
        </ul>
        </div>
    )
}
